import React, { useState } from 'react'
import styled from 'styled-components'
import { signUpInfo } from './signUpInfo'
import ValidationCheck from './ValidationCheck'
import SearchPostcode from '../../components/postcode/SearchPostCode'
import Postcode from '../../components/postcode/OpenPostCode'

type RadioInputField = {
  id: string;
  value: string;
  text: string;
}

type Birth = {
  name: string;
  placeholder: string;
}

const genderRadio: RadioInputField[] = [
  {
    id: "gender-man",
    value: "MALE",
    text: "남자",
  },
  {
    id: "gender-woman",
    value: "FEMALE",
    text: "여자",
  },
  {
    id: "gender-none",
    value: "NONE",
    text: "선택안함",
  },
]

const birth: Birth[] = [
  {
    name: "birthYear",
    placeholder: "YYYY"
  },
  {
    name: "birthMonth",
    placeholder: "MM"
  },
  {
    name: "birthDay",
    placeholder: "DD"
  },
]

export default function SignUpInput() {

  const {
    memberIdErr,
    memberIdErrMessage,
    passwordErr,
    passwordErrMessage,
    passwordChkErr,
    passwordChkErrMessage,
    nameErr,
    emailErr,
    emailErrMessage,
    phoneErr,
    phoneErrMessage,
    nameErrMessage,
    isActive,
    onChangeMemberId,
    onChangePassword,
    onChangePasswordChk,
    onChangeEmail,
    onChangePhone,
    onChangeName,
  } = ValidationCheck()

  const {
    isComplete,
    address,
    handleClick,
  } = SearchPostcode()
  return (
    <>
      {signUpInfo.map((item, index) => (
        <InputWrapper>
          <LeftWrapper>
            <LabelText>{item.label} {item.required ? <Star>*</Star> : ""}</LabelText>
          </LeftWrapper>
          <MiddleWrapper>
            <InputWrap>
              <InputInnerWrap>
                {item.label==="아이디" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangeMemberId} /> :
                item.label==="비밀번호" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangePassword} /> :
                item.label==="비밀번호확인" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangePasswordChk} /> :
                item.label==="이름" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangeName} /> :
                item.label==="이메일" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangeEmail} /> :
                item.label==="휴대폰" ?
                  <InputField
                    key={index} 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}
                    onChange={onChangePhone} /> : 
                item.label==="주소" ?
                  <AddressWrapper>
                  
                  </AddressWrapper> : 
                item.label==="성별" ?
                  <RadioContainer>
                    {genderRadio.map((item, index) => (
                      <RadioLabel key={index} htmlFor={item.id}>
                        <RadioInput 
                          key={index}
                          id={item.id}
                          name="gender"
                          value={item.value}/>
                        <RadioBtn><div></div></RadioBtn>
                        <RadioText>{item.text}</RadioText>
                      </RadioLabel> 
                    ))}
                  </RadioContainer> : 
                item.label==="생년월일" ?
                  <BirthContainer>
                    {birth.map((item, index) => (
                      <>
                      <Wrapper>
                        <InnerWrapper>
                          <BirthInput key={index} name={item.name} placeholder={item.placeholder} type="text" />
                        </InnerWrapper>
                      </Wrapper>
                      <Slash/>
                      </>
                    ))}
                </BirthContainer> : 
                  <InputField 
                    id={item.name}
                    name={item.name}
                    type={item.type}
                    placeholder={item.placeholder}/>
              }
              </InputInnerWrap>
            </InputWrap>
            {item.label==="아이디"&& memberIdErr && <AlertWrapper><Alert>{memberIdErrMessage}</Alert></AlertWrapper>}
            {item.label==="비밀번호"&& passwordErr!==0 && <AlertWrapper><Alert>{passwordErrMessage}</Alert></AlertWrapper>}
            {item.label==="비밀번호확인"&& passwordChkErr && <AlertWrapper><Alert>{passwordChkErrMessage}</Alert></AlertWrapper>}
            {item.label==="이름"&& nameErr && <AlertWrapper><Alert>{nameErrMessage}</Alert></AlertWrapper>}
            {item.label==="이메일"&& emailErr && <AlertWrapper><Alert>{emailErrMessage}</Alert></AlertWrapper>}
            {item.label==="휴대폰"&& phoneErr && <AlertWrapper><Alert>{phoneErrMessage}</Alert></AlertWrapper>}
            
          </MiddleWrapper>
          <RightWrapper>
            {item.duplicationCheck ? 
              <ButtonWrapper type="button">
                <span>중복확인</span>
              </ButtonWrapper> :
              item.certification ? 
                <ButtonWrapper type="button" disabled={!isActive}>
                  <span>인증번호 받기</span>
                </ButtonWrapper> : ""}
          </RightWrapper>
        </InputWrapper>
      ))}
    </>
  )
}

const InputWrapper = styled.div`
